def metadata_search(search_values:list):
    '''
    Takes in possible search parameters as follows, and returns a list of the titles of each (accessing the Dropbox
    corpus to do so)

    titles: list of any titles in the database to search those works in particular
    authors: list of any authors in the database to search works by them in particular
    languages: either "Latin", "Greek", or "both" (to search only works that contain both Latin and Greek text)
    centuries: list of anything from "8th BCE" through "18th CE"
    modern_locations: countries, i.e. "Greece", "Italy", "Turkey", etc.
    specific_locations: ancient cities, islands, and provinces, such as "Athens", "Lemnos", or "Bithynia"

    If leaving a certain search parameter open, enter the empty list [must enter a parameter for languages, however]
    '''
    from bs4 import BeautifulSoup

    titles = search_values[0]
    authors = search_values[1]
    languages = search_values[2]
    centuries = search_values[3]
    modern_locations = search_values[4]
    specific_locations = search_values[5]

    titles_match_list = []
    authors_match_list = []
    languages_match_list = []
    centuries_match_list = []
    modern_locations_match_list = []
    specific_locations_match_list = []
    final_matches_list = []

    for k in classical_ngrams_corpus_dict.keys():
        k_list = classical_ngrams_corpus_dict[k]

        if titles == []:
            titles_match_list.append(k)
        else:
            if k_list[0] in titles:
                titles_match_list.append(k)

        if authors == []:
            authors_match_list.append(k)
        else:
            if k_list[1] in authors:
                authors_match_list.append(k)

        if languages == "Latin":
            if "Latin" in k_list[2]:
                languages_match_list.append(k)
        elif languages == "Greek":
            if "Greek" in k_list[2]:
                languages_match_list.append(k)
        else:
            if k_list[2] == ["Greek", "Latin"]:
                languages_match_list.append(k)
            elif k_list[2] == ["Latin", "Greek"]:
                languages_match_list.append(k)

        if centuries == []:
            centuries_match_list.append(k)
        else:
            if k_list[3] in centuries:
                centuries_match_list.append(k)

        if modern_locations == []:
            modern_locations_match_list.append(k)
        else:
            if k_list[4] in modern_locations:
                modern_locations_match_list.append(k)

        if specific_locations == []:
            specific_locations_match_list.append(k)
        else:
            if k_list[5] in specific_locations:
                specific_locations_match_list.append(k)

        if k in titles_match_list:
            if k in authors_match_list:
                if k in languages_match_list:
                    if k in centuries_match_list:
                        if k in modern_locations_match_list:
                            if k in specific_locations_match_list:
                                final_matches_list.append(k)
    return final_matches_list
